VALUES ('2155688007006', 'Chicken Frites', 'Herrestellt in der Schweiz aus Schweizer Fleisch. Elaboré en Suisse avec de la viande suisse Zubereitung eus Pouletfielsch stOcken zusa mmengefügt, sufgetaut, mariniert, Préparation constituée de morces ux de viande de poulet, décongelée, marinée, zum Gekochtessen / à consommer cuite Kuchenhygiene Hinweis: Packung sorgfältig entfernen und weg: werfen. Tropfsaft weggiessen. Rohes Fleisch nicht in Kontakt mit anderen Lebensmitteln bringen. Geschirr und Hände gründlich rel - ngen. Fleisch immer gut durchgekocht/gebraten servieren. Zutaten: Pouletfleisch 90 %, Rapsöl, jodiertes Kochsalz, Gewürz Traubenzucker, Reisstarke, Palmfett gehärtet, Maltodextrin, Emul gator: E471, Geschmacksverstärker: Mononatriumglutamat, Säu - erungsmittel:E327, Verdickungsmittel: E401 Poulet Frites in der Pfanne ohne Fett ca. 7-8 min gut durchbraten. Mention d\'hygiene en cuipine: óter soigneusement l\'emballage et le jeter, Eliminer fe liquide d\'égouttenient. Ne pas mettre la vian contact avec d\'autres denrées alimentaires. Laver à fond la vaisselle et les mains. La viande doit toujours etre bien cuite, Ingredients: viande de poulet 90%, huile de colza, sel de cuisine iodé, épices, glucose, amidon de riz, graisse de palme hydro genée, maltodextrine, émylsifiant: E471.exhausteur de goût: glu Camste monosodique, acidifiant: E327, épaississant: E401.', 'https://static.openfoodfacts.org/images/products/215/568/800/7006/front_de.4.400.jpg', '11', '2.5', '1.5', '1', '0.5', '16', '0.9', '0.354330708661417', '', '1');

