VALUES ('2156942007503', 'magret de canard  congelé', 'MAGRET DE CANARD ROT IDEE RECETTE ELE SAUCE AIGRE DOUCE INGRÉDIENTS POUR 4 PERSONNES : MAGRET DE CANARD ROUGIE 1 PIECE SAUCE SOJA 1 CUILLERE A SOUPE MIEL TOUTES FLEURS - 1 CUILLERE A soupE SEL, POIVRE VINAIGRE BALSAMIQUE, DE CIDRE OU DE VIN 1 CUILLERE À SOUPE. PRÉPARATION: POUR FACILITER LA CUISSON, QUADRILLERS DU MAGRET TOUS LES 2 CM A L\'AIDE D\'UN COUTEAU, SANS E LA CHAIR. MÉLANGER LA SAUCE SOJA AVEC LE MIEL DILUER LE VINAIGRE. ETALER CETTE PRÉPARATION SUR LES 2 FACES LAISSER MARINER UNE HEURE AU REFRIGERATEUR, DANS U SOUS FILM ALIMENTAIRE. CUISSON DU MAGRET: RÉSERVER LA MARINADE. PRECHAU AU FOUR A 220°C/THERMOSTAT 7. Y CUIRE LE MAGRET COTE ENVIRON 10 MINUTES SELON LA CUISSON DÉSIRE. SALER, F RETIRER L\'EXCÉDENT DE GRAISSE FONDUE. LAISSER LE MAGE A COUVERT ET AU CHAUD. SUR LE FEU, FAIRE CARAMELISERL DE CUISSON EN RAJOUTANT ÉVENTUELLEMENT LE RESTE E LA MARINADE. DÉGLACER AVEC UN PEU D\'EAU. LAISSER REDU PRESENTATION: TRANCHER LE MAGRET EN SECTIONS DE8A SERVIR SUR UNE ASSIETTE CHAUDE. NAPPER AVEC LA SAUCE 0BTENIR UNE CONSISTANCE SIRUPEUSE. MODE DE DÉCONGELATION: LAISSER LE MAGRET DECONGELER 6 HEURES AU BAS DU REFRIGER', 'https://static.openfoodfacts.org/images/products/215/694/200/7503/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

