VALUES ('2173410006950', 'Saucisse aux choux', 'choux 40 %, lard, couenne, viande de porc, sang, sel nitrité (sel de cuisine, conservateur [E 2501), dextrose, épices, acidifiant (E 575), anti- oxydants (E 300, E 301). Enveloppe: boyau de bœuf. Préparation: Laisser cuire 45-50 minutes sur des légumes ou dans l\'eau chaude à 75-80 oc. L\'accompagnement idéal: le papet Vaudois. Pour préparer ce plat typiquement vaudois, coupez un blanc de poireau en trois tronçons de même longueur, faites-les revenir avec des oignons et mouillez avec du vin blanc et du bouillon.', 'https://static.openfoodfacts.org/images/products/217/341/000/6950/front_fr.4.400.jpg', '39', '16', '5', '0', '0', '10', '1.9', '0.748031496062992', '', '0');

